import React from "react";
import '../footer/footer.css'
import music_empty from '../../img/music_empty.svg'

function Footer(){
    return(
        <div className="footer">
            <img src={music_empty}></img>
            <div className="bar_musictitle">재생목록이 비어있습니다</div>

        </div>

    )
}
export default Footer
